    public void testPrintHashTableMutation() {
        // Create a sample HashTable
        HashTable hashTable = new HashTable(4, 16);

        // Set up a scenario where table[i] is not equal to TOMBSTONE
        Seminar seminar = new Seminar(1, "Sample Seminar", "2023-09-10", 60, (short) 10, (short) 20, 100,
                new String[]{"keyword1", "keyword2"}, "Sample description");
        ///hashTable.table[0] = new Seminar(); // Replace with an actual Seminar instance
        hashTable.addSeminar(seminar);

        // Redirect System.out to capture the output
        ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
        PrintStream printStream = new PrintStream(outputStream);
        System.setOut(printStream);

        // Call the printHashTable method
        hashTable.printHashTable();

        // Restore the original System.out
        System.setOut(System.out);

        // Get the output
        String output = outputStream.toString();

        // Assert that the output does not contain the line "i: TOMBSTONE"
        assertFalse(output.contains("1: TOMBSTONE"));
        
        // Assert that the output contains the line "0: " (indicating a non-TOMBSTONE value)
        assertTrue(output.contains("1: 1"));
    }
    
	
