    private static boolean isPowerOfTwo(int num) {
        return (num > 0) && ((num & (num - 1)) == 0);
    }
    
    public void testNegativeNumberAsArgument() {
        int arg1 = -32;  // -2^5
        int arg2 = 64;   // 2^6
        assertTrue(!isPowerOfTwo(arg1) || !isPowerOfTwo(arg2));
    }
   
    
    public void testNegativeBothNumberAsArgument() {
        int arg1 = -32;  // -2^5
        int arg2 = -64;   // -2^6
        assertTrue(!isPowerOfTwo(arg1) || !isPowerOfTwo(arg2));
    } 
    
    public void testZeroNeagtiveAsArgument() {
        int arg1 = 0;
        int arg2 = -8;  // -2^3
        assertTrue(!isPowerOfTwo(arg1) || !isPowerOfTwo(arg2));
    }
    
