        int arg1 = 16;  // 2^4
        int arg2 = 5;
        assertTrue(!isPowerOfTwo(arg1) || !isPowerOfTwo(arg2));
    }
    
    public void testBothArgumentsAreNotPowersOfTwo() {
        int arg1 = 3;
        int arg2 = 7;
        assertTrue(!isPowerOfTwo(arg1) || !isPowerOfTwo(arg2));
    }
    
    public void testBothArgumentsArePowersOfTwo() {
        int arg1 = 4;  // 2^2
        int arg2 = 8;  // 2^3
        assertFalse(!isPowerOfTwo(arg1) || !isPowerOfTwo(arg2));
    }
    
