        assertTrue(SemManager.isPowerOfTwo(1));
        assertTrue(SemManager.isPowerOfTwo(2));
    }
    
    public void testZero() {
        // Test with zero
        assertFalse(SemManager.isPowerOfTwo(0));
    }
    
