using System.Collections;
using System.Collections.Generic;
using HyperCasualPack.ScriptableObjects;
using HyperCasualPack.ScriptableObjects.Channels;
using UnityEngine;
using UnityEngine.InputSystem;
using UnityEngine.InputSystem.HID;

namespace HyperCasualPack
{
    public class PlayerController : MonoBehaviour, IInteractor
    {
        public static PlayerController playerController;
        public string requestObjectInHandString = null;
        private GameObject requestHandGameObject = null;
        private Transform objectLiftedPoint;

        [SerializeField] MovementDataSO _movementDataSO;
        [SerializeField] InputChannelSO _inputChannelSO;
        [SerializeField] Camera mainCamera;
        [SerializeField] Transform rightHand;
        [SerializeField] Transform leftHand;
        [SerializeField] Rigidbody _rbd;

        //Vaiables para el movmiento del personaje
        private PlayerInput playerInput;
        private Vector3 _currentInputVector;
        private Vector2 input;
        private float force = 100;
        private float range = 3f;

        //Cambia IsInteractable a true su currentMagnitud es menor a 0.3
        bool IInteractor.IsInteractable => _currentInputVector.sqrMagnitude < 0.3f;

        private void Awake()
        {
            playerController = this;
        }

        public static PlayerController Instance
        {
            get
            {
                if (playerController == null)
                    Debug.LogError("ScoreManager is Null");
                return playerController;
            }
        }

        void Start()
        {
            playerInput = GetComponent<PlayerInput>();
        }

        void OnEnable()
        {
            _inputChannelSO.JoystickUpdate += OnJoystickUpdate;
        }

        void OnDisable()
        {
            _inputChannelSO.JoystickUpdate -= OnJoystickUpdate;
        }

        //Actualiza los valores del joystick
        void OnJoystickUpdate(Vector2 newMoveDirection)
        {
            if (newMoveDirection.magnitude >= 1f)
            {
                newMoveDirection.Normalize();
            }

            _currentInputVector = new Vector3(newMoveDirection.x * _movementDataSO.SideMoveSpeed, 0f, newMoveDirection.y * _movementDataSO.ForwardMoveSpeed);
            Vector3 lookDir = new Vector3(_currentInputVector.x, 0f, _currentInputVector.z);
            if (lookDir != Vector3.zero)
            {
                transform.rotation = Quaternion.LookRotation(lookDir, Vector3.up);
            }
        }

        void Update()
        {
            RaycastHit hit;
            Ray searchRay = new Ray(transform.position + new Vector3(0,1.2f,0), transform.forward);
            Debug.DrawRay(searchRay.origin, searchRay.direction * 1f);
            if (Physics.Raycast(searchRay, out hit, 1f))
            {
                ObjectAnalyser(hit.transform.gameObject);
            }
        }

        void ObjectAnalyser(GameObject interactiveObject)
        {
            if (interactiveObject.CompareTag("Guest"))
            {
                GuestBehaviour guest = interactiveObject.GetComponent<GuestBehaviour>();
                if (guest != null)
                {
                    if (PartyManager.Instance.requestedConversations.Count > 0 && guest.petitionObject == "conversation")
                    {
                        PartyManager.Instance.UpdatePoints("conversation");
                        guest.DispatchRequest("conversation");
                    }

                    if (requestObjectInHandString.Length == 0 || requestObjectInHandString == null)
                    {
                        return;
                    }

                    else
                    {                   
                        if (guest.petitionObject != requestObjectInHandString || (guest.petitionObject == null && requestObjectInHandString == null))
                        {
                            return;
                        }

                        else
                        {
                            PartyManager.Instance.UpdatePoints(requestObjectInHandString);
                            switch (requestObjectInHandString)
                            {
                                case "drink":
                                    ServeDrinkTable.Instance.drinksPool.RemoveAt(0);
                                    break;
                            }
                            ReturnObjectToPool();
                            guest.DispatchRequest(requestObjectInHandString);
                        }
                    }
                }
            }

            else if(interactiveObject.CompareTag("Prepare Drink Table"))
            {
                PrepareDrinkTable.Instance.interactionWithTable = true;
            }

            else if(interactiveObject.CompareTag("Drink"))
            {
                requestObjectInHandString = "drink";
                ServeDrinkTable.Instance.SearchFirstDrinkInPool();
            }            
        }

        void FixedUpdate()
        {
            _rbd.velocity = new Vector3(_currentInputVector.x, _rbd.velocity.y, _currentInputVector.z);
        }

        public void LiftObject(GameObject objectInService)
        {
            requestHandGameObject = objectInService;
            PartyManager.Instance.SetParent(objectInService, rightHand);
        }

        public void ReturnObjectToPool()
        {
            requestObjectInHandString = null;
            if (requestHandGameObject != null)
            {
                PartyManager.Instance.SetParent(requestHandGameObject, ServeDrinkTable.Instance.transform);
                requestHandGameObject = null;
            }            
        }
    }
}

using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.UI;
using TMPro;

public class PartyManager : MonoBehaviour
{
    public static PartyManager partyManager;
    public List<Image> requestedDrinks = new List<Image>();
    public List<Image> requestedConversations = new List<Image>();
    public TextMeshProUGUI successLevelText;
    public TextMeshProUGUI levelTimerText;
    public TextMeshProUGUI levelMoneyText;
    public Slider enjoymentSlider;
    public float levelTime; 
    public int enjoymentBarValue;
    public int money;

    private int levelSuccessValue;

    private void Awake()
    {
        partyManager = this;
        levelTime = 60f;
        money = 0;
    }

    public static PartyManager Instance
    {
        get
        {
            if (partyManager == null)
                Debug.LogError("ScoreManager is Null");
            return partyManager;
        }
    }

    private void Update()
    {
        levelTime -= Time.deltaTime;
        levelTimerText.text = levelTime.ToString();

        if (levelTime <= 0)
        {
            successLevelText.gameObject.SetActive(true);
            if (enjoymentSlider.value >= 10)
            {
                successLevelText.text = "Level Success";
            }
            else
            {
                successLevelText.text = "FAILED";
            }
        }
    }

    public void UpdatePoints(string reward)
    {
        switch (reward)
        {
            case "drink":
                //Puntos de Enjoyment
                enjoymentSlider.value += 0.05f;
                break;
            case "conversation":
                //Puntos de Dinero
                money += 250;
                levelMoneyText.text = money.ToString();
                break;
        }
    }

    public void SetParent(GameObject requestPrefab, Transform newParent)
    {
        requestPrefab.transform.parent = newParent;
        requestPrefab.transform.position = newParent.transform.position + new Vector3(0.0f, 0.75f, 0f);
    }
}

using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class ServeDrinkTable : TableBehaviour
{
    public List<byte> occupiedSpaces = new List<byte>();
    public List<GameObject> drinksPool = new List<GameObject>();
    public GameObject interactiveArea;
    public int serveTableMaxCapacity;

    public static ServeDrinkTable Instance; 
    [SerializeField] private GameObject drinkPrefab;

    protected override void Awake()
    {
        if (Instance == null)
        {
            Instance = this;
        }
        else
        {
            Destroy(gameObject);
        }
        base.Awake();
    }

    private void Start()
    {
        serveTableMaxCapacity++;
    }

    void AddDrinkToPool(int amount)
    {
        for (int i = 0; i < amount; i++)
        {
            GameObject drink = Instantiate(drinkPrefab);
            drinksPool.Add(drinkPrefab);
            PartyManager.Instance.SetParent(drink, this.transform);
        }
    }

    public GameObject RequestedDrink()
    {
        for (int i = 0; i < drinksPool.Count; i++)
        {
            if (!drinksPool[i].activeSelf)
            {
                drinksPool[i].SetActive(true);
                return drinksPool[i];
            }
        }
        AddDrinkToPool(1);
        drinksPool[drinksPool.Count - 1].SetActive(true);
        return drinksPool[drinksPool.Count - 1];
    }

    public void SearchFirstDrinkInPool()
    {
        HyperCasualPack.PlayerController.Instance.LiftObject(drinksPool[0]);
    }
}

    struct Object {
        Object(T content, int priority, size_t heap_pos)
            : content(std::move(content)), priority(priority), heap_pos(heap_pos) 
        {
        }

        T content;
        int priority;
        size_t heap_pos;
    };

    using HeapItem = std::pair<Id, size_t>;
    using Heap = std::vector<HeapItem>;

#include <tuple>

    bool greater(HeapItem  const & lhs, HeapItem const & rhs) const noexcept
    {
        auto left_priority = storage[lhs.first].value().priority;
        auto right_priority = storage[rhs.first].value().priority;
        return std::tie(left_priority, lhs.second) >
            std::tie(right_priority, rhs.second);
    }

    size_t heap_promote(size_t pos)
    {
        if (pos == 0)
            return pos;
        size_t next_pos = (pos - 1) / 2;

        while (greater(heap[pos], heap[next_pos])) 
        {
            std::swap(storage[heap[pos].first].value().heap_pos,
                storage[heap[next_pos].first].value().heap_pos);
            std::swap(heap[pos], heap[next_pos]);
            if (!next_pos)
                break;
            else
            {
                pos = next_pos;
                next_pos = (pos - 1) / 2;
            }
        }
        return pos;
    }

